-- required libraries
local csgo_weapons = require 'gamesense/csgo_weapons' or error('gamesense/csgo_weapons library is required')
local images = require 'gamesense/images' or error('gamesense/images library is required')

-- localize api
local client_set_event_callback = client.set_event_callback
local client_screen_size = client.screen_size
local client_key_state = client.key_state

local entity_get_local_player = entity.get_local_player
local entity_get_player_weapon = entity.get_player_weapon
local entity_get_prop = entity.get_prop

local renderer_rectangle = renderer.rectangle
local renderer_circle = renderer.circle
local renderer_circle_outline = renderer.circle_outline
local renderer_text = renderer.text
local renderer_measure_text = renderer.measure_text

local ui_mouse_position = ui.mouse_position
local ui_is_menu_open = ui.is_menu_open

local database_read = database.read
local database_write = database.write

-- local variables
local screen = {client_screen_size()}

local hud = {
    x = database_read("hud_x") or 1250,
    y = database_read("hud_y") or 250,
    dragging = false,
}

-- check if mouse intersects a rectangular area
local function intersect(x, y, w, h, debug) 
    local cx, cy = ui_mouse_position()
    debug = debug or false
    if debug then 
        renderer_rectangle(x, y, w, h, 255, 0, 0, 50)
    end
    return cx >= x and cx <= x + w and cy >= y and cy <= y + h
end

-- draw the hud 
local function draw_hud()
    -- local player data
    local local_player = entity_get_local_player()
    -- csgo weapon data
	local weapon_ent = entity_get_player_weapon(local_player)
	local weapon_idx = entity_get_prop(weapon_ent, 'm_iItemDefinitionIndex')
	local weapon = csgo_weapons[weapon_idx]
    local weapon_icon = images.get_weapon_icon(weapon)

    local health = math.min(100, entity_get_prop(local_player, 'm_iHealth'))
    local armor = math.min(100, entity_get_prop(local_player, 'm_ArmorValue'))

    -- return if player doesnt exist or weapon doesnt exist
    if local_player == nil or weapon_ent == nil or weapon_idx == nil or weapon == nil or weapon_icon == nil then return end

    -- get the colors for the health
    local hpr = (50*health/100) + (255*(1-health/100))
    local hpg = (255*health/100) + (75*(1-health/100))
    local hpb = (65*health/100) + (20*(1-health/100))

    -- move the hud when the menu is open
    local cx, cy = ui_mouse_position()
	local left_click = client_key_state(0x01)
    if ui_is_menu_open() then 
		if hud.dragging and not left_click then
			hud.dragging = false
		end
	
		if hud.dragging and left_click then
			hud.x = cx - hud.drag_x
			hud.y = cy - hud.drag_y
		end
	
        if intersect(hud.x-62, hud.y-62, 124, 124, false) and left_click then 
			hud.dragging = true
			hud.drag_x = cx - hud.x
            hud.drag_y = cy - hud.y
        end
    end

    -- current weapon data
    local ammo = entity_get_prop(weapon_ent, 'm_iClip1') or -1
    local reserve
    if ammo ~= -1 then
        reserve = entity.get_prop(weapon_ent, 'm_iPrimaryReserveAmmoCount') or 0
    else
        reserve = ''
    end

    -- get values
    local bar_width = 1/weapon.primary_clip_size
    local icon_measure = {weapon_icon:measure()}
    local reserve_measure = {renderer_measure_text('b', reserve)}
    local health_measure = {renderer_measure_text('b', health)}
    local armor_measure = {renderer_measure_text('b', armor)}

    -- render the center circle and its outline
    renderer_circle_outline(hud.x, hud.y, 12, 12, 12, 123, 40, 0, 1, 40)
    for i = 1, 10 do
        renderer_circle_outline(hud.x, hud.y, 13*i, 13*i, 13*i, 125, 40+1*i, 0, 1, 1)
    end

    -- ammo bars
    for i = 1, ammo do
        renderer_circle_outline(hud.x, hud.y, 255, 255, 255, 175, 50, 180-bar_width*360*i, bar_width-0.005, 5)
    end
    if ammo == -1 then
        renderer_circle_outline(hud.x, hud.y, 255, 255, 255, 175, 50, 0, 1, 5)
    end
    -- render the icon
    weapon_icon:draw(hud.x-icon_measure[1]*0.8/2, hud.y-icon_measure[2]*0.8/2, icon_measure[1]*0.8, icon_measure[2]*0.8, 255, 255, 255, 175, false, 'f')
    renderer_text(hud.x-reserve_measure[1]/2, hud.y+25, 255, 255, 255, 175, 'b', 0, reserve)

    -- health circle and text
    renderer_circle_outline(hud.x, hud.y, 10, 10, 10, 75, 60, 120, 0.34, 5)
    renderer_circle_outline(hud.x, hud.y, hpr, hpg, hpb, 150, 60, 120, 0.34*health/100, 5)
    renderer_text(hud.x-health_measure[1]/2, hud.y-63, hpr, hpg, hpb, 175, 'b', 0, health)

    -- armor circle and text
    renderer_circle_outline(hud.x, hud.y, 10, 10, 10, 75, 60, 300, 0.34, 5)
    renderer_circle_outline(hud.x, hud.y, 75, 75, 255, 175, 60, 300, 0.34*armor/100, 5)
    renderer_text(hud.x-armor_measure[1]/2, hud.y+49, 75, 75, 255, 175, 'b', 0, armor)
end
client_set_event_callback('paint', draw_hud)

-- write the huds location on shutdown
client_set_event_callback('shutdown', function()
    database_write("hud_x", hud.x)
    database_write("hud_y", hud.y)
end)
